        <div
          style={{
            position: "absolute",
            width: "50%",
            height: "-webkit-fill-available",
            left: "50%",
            background: "#FFF3CC",
          }}
        >
          {screen === "" ? (
            <>
              {Doc === "English" ? (
                <div>
