                      position: "fixed",
                      top: 20,
                      left: width * 0.59,
                      textAlign: "-webkit-center",
                      width: 500,
                      background: " #FFFFFF",
                      boxShadow: " 0px 4px 25px rgba(0, 0, 0, 0.15)",
                      borderRadius: 20,
                      padding: 30,
                    }}
